import React from 'react';
import MovieCard from './MovieCard';

const MovieList = ({movies}) => {

	const movieList = movies.map((movie) => {
		return <MovieCard
						title={movie.title}
						poster={movie.poster_path}
					/>
	})

	return <div>{movieList}</div>;
}

export default MovieList;

